import React from 'react'
import './CardBottom.css'
import card1 from '../Images/card1.png'
import card2 from '../Images/card2.png'
import card3 from '../Images/card3.png'
import card4 from '../Images/card4.png'
const CardBottom= (props) => {
    const {data} = props

        

  return (
    <div className='cardMain'>
        <h1>{data.ID}</h1>
        if({data.ID} === 1 ){
            <img src={card1} alt='ss' className='cardImg'/>
        }
        else if( {data.ID}=== 2 || ){
            <img src={card2} alt='ss' className='cardImg'/>
        }
        else if({Number(data.ID)} ===3 || ){
            <img src={card3} alt='ss' className='cardImg'/>
        }
        else{
            <img src={card4} alt='ss' className='cardImg'/>
        }
        <div className='subCard'>
                <h1>{data.h1}</h1>
                <p>{data.p}</p>
                <h3>{data.h1_bottom}</h3>
        </div>
    </div>
  )
}
export default CardBottom
